import React from 'react';
import Map from './Map';
import Menu from './Menu';
import GameText from './GameText';
import { AppContainer } from './styles/globalStyles';

class App extends React.Component {
    render() {
        return (
            <AppContainer>
                <Menu />
                <Map />
                <GameText />
            </AppContainer>
        )
    }
}

export default App;
